import GlobalStyle from '../styles/GlobalStyles';
import { Container, Main, Title } from '../styles/Landing';

import GraduationCap from '../assets/graduation-cap.svg';

const Index = () => (
    <Container>

        <Main>
            <img src={graduationCap} alt="dsadas"/>
            <Title></Title>
        </Main>


        <GlobalStyle />
    </Container>
)

export default Index;
